// LocationList.js
import React from 'react';

function LocationList({ locations }) {
  return (
    <div>
      {locations.map((location, index) => (
        <p key={index} style={{ color: 'grey' }}>{location}</p>
      ))}
    </div>
  );
}

export default LocationList;
